def init():
	global gdCashGoodsToSid,gdTradeCashGoodSToSid,gdQualityProps
	for sid,lst in gdCashGoodsList.iteritems():
		for goodsId in lst:
			gdCashGoodsToSid[goodsId] = sid

	for sid,lst in gdTradeCashGoodsList.iteritems():
		for goodsId in lst:
			gdTradeCashGoodSToSid[goodsId] = sid

	for goodsId,data in gdTradeCashGoods.iteritems():
		if goodsId < 1000000:
			continue
		goodsIdList = gdQualityProps.setdefault(data["商品编号"],[])
		goodsIdList.append(goodsId)

